import './App.css';
import Card from './Card.jsx';
import Navbar from './Navbar.jsx'

let myObj = {
  title: "Mistborn",
  subtitle: "example",
  desc: "This is the description part of the thing."
}

function App() {
  return (
    <div className="App">
      <Navbar />
      <Card book={myObj}/>
    </div>
  );
}

export default App;
